import React, {Component} from 'react';

class Holamundo extends Component{
    constructor(props){
        super(props);
        this.state = {
            x: "primero",
        }

        this.modificarEstado = this.modificarEstado.bind(this);
    }

modificarEstado(){
    console.log(this.state.x)
    this.setState({
        x: "Hola",
    })
    console.log(this.state.x)
}

    render(){
        console.log("hola");
        return(
            <div className="Hola">
                <p>Hola Mundo</p>
                <button onClick = {this.modificarEstado}>Boton</button>
                <p>{this.state.x}</p>
            </div>
        )
    }   
}

export default Holamundo;
